import React from "react";

export default () => {
  return (
    <div>
      <h5 className="no-margin">Cookie flavor preferences </h5>
      <ul className="gray-background list">
        <li className="first-li">1st Mommy Chocolate Baby Chip</li>
        <li>2nd Cherry Blossom Sweeet Pie</li>
        <li>3rd 3-stacks-vanilla Pie</li>
      </ul>
    </div>
  );
};
